svg.script:
// Global variables for mapApp and map object.
var myMapApp = new mapApp(false,undefined);
var myMainMap;

function init(evt) 
{
	// Dynamic layer array that allow loading from database.
	var dynamicLayers = new Array();
	// Initialize digiLayers (layers that allow digitizing)
	var digiLayers = new Array();

	// Define some styles for the map object.
	var zoomRectStyles = {"fill":"none","stroke":"crimson","stroke-width":0.002,"stroke-dasharray":"0.012,0.002"};
	var highlightStyles = {"stroke":"crimson","stroke-width":0.002};
	var dragRectStyles = {"fill":"lightskyblue","fill-opacity":0.5};

	// Window styles.
	var winPlaceholderStyles = {"fill":"none","stroke":"dimgray","stroke-width":1.5};
	var windowStyles = {"fill":"aliceblue","stroke":"dimgray","stroke-width":1};
	var titlebarStyles = {"fill":"steelblue","stroke":"dimgray","stroke-width":1};
	var statusbarStyles = {"fill":"aliceblue","stroke":"dimgray","stroke-width":1};
	var titletextStyles = {"font-family":"Arial,Helvetica","font-size":12,"fill":"white","font-weight":"bold"};
	var statustextStyles = {"font-family":"Arial,Helvetica","font-size":8,"fill":"white"};
	var windowButtonStyles ={"fill":"steelblue","stroke":"white","stroke-width":2};

	// Button styles, adopt the style settings to match your needs.
	var buttonTextStyles = {"font-family":"Arial,Helvetica","fill":"dimgray","font-size":10};
	var buttonStyles = {"fill":"white"};
	var shadeLightStyles = {"fill":"rgb(235,235,235)"};
	var shadeDarkStyles = {"fill":"dimgray"};

	// Zoom slider styles
	var sliderStyles={"stroke":"dimgray","stroke-width":2};

	// Checkbox labeltext styles
	var labeltextStyles = {"font-family":"Arial,Helvetica","fill":"dimgray","font-size":15};

	// Initialize myMainMap object, you need to adopt the parameters here
	// Parameters: p2, p3: max and min map width for zooming, p4: zoom factor.
	myMainMap = new map("mainMap",404464,50000,0.6,0,2056,' m',1,true,"coordX","coordY",dynamicLayers,digiLayers,"",zoomRectStyles,highlightStyles,dragRectStyles,"referenceMap","myDragCrossSymbol",4750);

	// Create windows
	myMapApp.windows = new Array();
	// Parameters: p3: window width, p4: window height, p5, p6: window position left top.
	myMapApp.windows["navWindow"] = new Window("navWindow","windows",220,180,17,60,true,10,10,1014,758,true,winPlaceholderStyles,windowStyles,3,true,false,"Navigation"," ",false,true,true,titlebarStyles,15,statusbarStyles,12,titletextStyles,statustextStyles,windowButtonStyles,undefined);
	// Append navigation elements to the window.
	myMapApp.windows["navWindow"].appendContent("referenceMap",true);
	myMapApp.windows["navWindow"].appendContent("naviContent",true);

	// Create zoom slider.
	myMapApp.zoomSlider = new slider("mapZoomSlider","mapZoomSlider",195,47,myMainMap.minWidth,195,92,myMainMap.maxWidth,myMainMap.maxWidth,sliderStyles,10,"sliderSymbol",myMapApp.refMapDragger,true);

	//now initialize buttons
	myMapApp.buttons = new Array();
	//button instance creation
	//groupId,functionToCall,buttonType,buttonText,buttonSymbolId,x,y,width,height,textStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,shadowOffset
	myMapApp.buttons["zoomIn"] = new button("zoomIn","zoomIn",zoomImageButtons,"rect",undefined,"magnifyerZoomIn",185,22,20,20,buttonTextStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,1);
	myMapApp.buttons["zoomOut"] = new button("zoomOut","zoomOut",zoomImageButtons,"rect",undefined,"magnifyerZoomOut",185,100,20,20,buttonTextStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,1);
	myMapApp.buttons["infoButton"] = new switchbutton("infoButton","infoButton",zoomImageSwitchButtons,"rect",undefined,"infoBut",5,135,20,20,buttonTextStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,1);
	myMapApp.buttons["infoButton"].setSwitchValue(true,false);
	statusChange("Mode: Infomode");
	myMapApp.buttons["zoomFull"] = new button("zoomFull","zoomFull",zoomImageButtons,"rect",undefined,"magnifyerFull",35,135,20,20,buttonTextStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,1);
	myMapApp.buttons["zoomManual"] = new switchbutton("zoomManual","zoomManual",zoomImageSwitchButtons,"rect",undefined,"magnifyerManual",65,135,20,20,buttonTextStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,1);
	myMapApp.buttons["panManual"] = new switchbutton("panManual","panManual",zoomImageSwitchButtons,"rect",undefined,"symbPan",95,135,20,20,buttonTextStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,1);
	myMapApp.buttons["recenterMap"] = new switchbutton("recenterMap","recenterMap",zoomImageSwitchButtons,"rect",undefined,"symbRecenter",125,135,20,20,buttonTextStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,1);
	myMapApp.buttons["backwardExtent"] = new button("backwardExtent","backwardExtent",zoomImageButtons,"rect",undefined,"symbArrowLeft",155,135,20,20,buttonTextStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,1);
	myMapApp.buttons["forwardExtent"] = new button("forwardExtent","forwardExtent",zoomImageButtons,"rect",undefined,"symbArrowRight",185,135,20,20,buttonTextStyles,buttonStyles,shadeLightStyles,shadeDarkStyles,1);
	myMainMap.checkButtons();

	myMapApp.checkboxes = new Array();
	myMapApp.checkboxes["WMS"] = new checkBox("WMS","checkBoxes",0,462,"checkBoxRect","checkBoxCross",true,"WMS Rivers",labeltextStyles,12,5,undefined,toggleMapLayer);


	//load function specific to the current map project
	loadProjectSpecific();
}

//this function is called after each pan or zoom or change of map extent
//you can place project specific functions here that need to react on the map extent, e.g. adopting line-widths, loading additional data, etc.
function loadProjectSpecific() 
{
	getWMSImage() ;
}

function getWMSImage() 
{
	var myRasterLayer = document.getElementById("WMS");
	if (myRasterLayer.childNodes.length > 0) {
		var oldImage = document.getElementById("WMSImage");
		myRasterLayer.removeChild(oldImage);
	}
	if (document.getElementById("WMS").getAttributeNS(null,"visibility") == "visible") {
		var myRasterImage = document.createElementNS(svgNS,"image");
		myRasterImage.setAttributeNS(null,"x",myMainMap.curxOrig);
		myRasterImage.setAttributeNS(null,"y",myMainMap.curyOrig);
		myRasterImage.setAttributeNS(null,"width",myMainMap.curWidth);
		myRasterImage.setAttributeNS(null,"height",myMainMap.curHeight);
		myRasterImage.setAttributeNS(null,"id","WMSImage");
		myRasterImage.setAttributeNS(null,"pointer-events","none");
		var myImageUrl = "http://karlinapp.ethz.ch/cgi-bin/qgis_map_server/mmkarto/qgis_mapserv.fcgi?SERVICE=WMS&version=1.3.0&request=GetMap&Layers=ch_rivers&Styles=mystyle&SRS=EPSG:" + myMainMap.epsg;
		myImageUrl += "&BBOX=" + parseInt(myMainMap.curxOrig) + "," + (parseInt(myMainMap.curyOrig + myMainMap.curHeight) * -1);
		myImageUrl += "," + parseInt(myMainMap.curxOrig + myMainMap.curWidth) + "," + (parseInt(myMainMap.curyOrig) * -1);
		myImageUrl += "&width=" + parseInt(myMainMap.pixWidth) + "&height=" + parseInt(myMainMap.pixHeight) + "&format=image/png&TRANSPARENT=true&SLD_BODY=" + '<StyledLayerDescriptor xmlns="http://www.opengis.net/sld" units="mm" ><NamedLayer xmlns="http://www.opengis.net/sld"><Name xmlns="http://www.opengis.net/sld">ch_rivers</Name><UserStyle xmlns="http://www.opengis.net/sld"><Name xmlns="http://www.opengis.net/sld">mystyle</Name><FeatureTypeStyle xmlns="http://www.opengis.net/sld"><Rule xmlns="http://www.opengis.net/sld"><LineSymbolizer xmlns="http://www.opengis.net/sld"><Stroke xmlns="http://www.opengis.net/sld"><CssParameter xmlns="http://www.opengis.net/sld" name="stroke" >%2355aaff</CssParameter><CssParameter xmlns="http://www.opengis.net/sld" name="stroke-width" >0</CssParameter></Stroke></LineSymbolizer></Rule></FeatureTypeStyle></UserStyle></NamedLayer></StyledLayerDescriptor>';
		// alert(myImageUrl);
		myRasterImage.setAttributeNS(xlinkNS,"xlink:href",myImageUrl);
		myRasterLayer.appendChild(myRasterImage);
	}
}

function toggleMapLayer (id, status, text)
{
	var layer_id = id.replace(/cb_/g, "");
	if (status)
	{
		document.getElementById(layer_id).setAttributeNS(null,"visibility","visible");
		if (id == "WMS") {
			getOrthoImage();
		}
	}
	else
	{
		document.getElementById(layer_id).setAttributeNS(null,"visibility","hidden");
	}
}

function showInfo(evt) {
	var info = evt.target.getAttributeNS('http://www.carto.net/attrib/','name');
	var pop = parseFloat(evt.target.getAttributeNS('http://www.carto.net/attrib/','bev_1970'));
	var infotext = document.getElementById("infotext");
	var infotext1 = document.getElementById("infotext1");
	infotext.firstChild.nodeValue = 'Canton: ' + info;
	infotext1.firstChild.nodeValue = 'Population 1970: ' + pop;
	evt.target.setAttributeNS(null, "fill", "#f88");
}	

function hideInfo(evt) {
	var infotext = document.getElementById("infotext");
	var infotext1 = document.getElementById("infotext1");
	var canton_color = evt.currentTarget.getAttributeNS(null, "fill");
	infotext.firstChild.nodeValue = " ";
	infotext1.firstChild.nodeValue = " ";
	evt.target.setAttributeNS(null, "fill", canton_color);
}
